import jsPDF from "jspdf";

export function generateCertificatePDF({
  name,
  history,
  meaning,
  usedWiki,
}: {
  name: string;
  history: string;
  meaning: string;
  usedWiki: boolean;
}) {
  const doc = new jsPDF();

  const capitalizeFirstLetter = (str: string) => {
    return str.charAt(0).toUpperCase() + str.slice(1);
  };

  const pageWidth = doc.internal.pageSize.getWidth();
  const pageHeight = doc.internal.pageSize.getHeight();
  const margin = 20;
  const contentWidth = pageWidth - margin * 2;
  let currentY = 40;
  const bgImageBase64 = "data:image/png;base64,";
  const logoImageBase64 = "data:image/png;base64,";
    // ADD BACKGROUND
  doc.addImage(bgImageBase64, 'PNG', 0, 0, pageWidth, pageHeight);

  // ADD LOGO
  const logoWidth = 60;
  const logoHeight = 60;
  const logoX = (pageWidth - logoWidth) / 2;
  const logoY = 30;

  doc.addImage(logoImageBase64, 'PNG', logoX, logoY, logoWidth, logoHeight);

  currentY = logoY + logoHeight + 20;
  // TITLE
  doc.setFontSize(22);
  doc.text("Name Certificate", pageWidth / 2, currentY, { align: "center" });
  currentY += 20;

  // NAME
  doc.setFontSize(18);
  doc.text(capitalizeFirstLetter(name), pageWidth / 2, currentY, { align: "center" });
  currentY += 20;

  // HISTORY
  if (history && history.trim() !== "") {
    doc.setFontSize(14);
    doc.text("HISTORY", margin, currentY);
    currentY += 10;

    doc.setFontSize(12);
    const historyLines = doc.splitTextToSize(history, contentWidth);
    doc.text(historyLines, margin, currentY);
    currentY += historyLines.length * 7;
  }

  // MEANING
  doc.setFontSize(14);
  doc.text("MEANING", margin, currentY);
  currentY += 10;

  doc.setFontSize(12);
  const meaningLines = doc.splitTextToSize(meaning, contentWidth);
  doc.text(meaningLines, margin, currentY);
  currentY += meaningLines.length * 7;

  // FOOTER
  const generatedDate = new Date().toLocaleDateString();
  doc.setFontSize(10);
  doc.text(`Generated on ${generatedDate}`, margin, pageHeight - margin);
  doc.text(`Generated with  by nomena.io`, pageWidth - margin, pageHeight - margin, { align: "right" });

  // SAVE PDF
  doc.save(`${capitalizeFirstLetter(name)}_Certificate.pdf`);
}
